import {createTheme, Grid} from "@material-ui/core";
import {MuiThemeProvider} from "material-ui";
import TranslationTable from "./TranslationTable";
import {useState} from "react";
import Search from "./Search";
import '@axa-ch/modal';
import '@axa-ch/input-text';
import AXAModalReact from "./AXAModalReact";

export default function TranslationWrapper() {

    const [open, setOpen] = useState(false)
    const handleOpen = () => setOpen(true);
    const handleClose = () => setOpen(false);


    const theme = createTheme({
        palette: {
            primary: {
                light: '#3f51b5', main: '#2425aa', dark: '#002884', contrastText: '#fff',
            }, secondary: {
                light: '#ff7961',
                main: '#d32f2f',
                dark: '#ba000d',
                contrastText: '#fff',
            },
        },
    });


    return (
        <div className="translationWrapper">
            <MuiThemeProvider theme={theme}>
                <Grid container direction={"row"} className={"gridContainer"}>
                    <Grid item xs={10}>
                        <Search/>
                    </Grid>
                    <Grid item xs={2}>
                        <axa-button onClick={handleOpen}> Neue Ãœbersetzung</axa-button>
                        <AXAModalReact open={open} onClose={handleClose}>
                            <div className={"newTranslationInputField"}>
                                <axa-input-text placeholder="App-ID"
                                />
                            </div>

                            <div className={"newTranslationInputField"}>
                                <axa-input-text placeholder="Kontext"
                                />
                            </div>

                            <div className={"newTranslationInputField"}>
                                <axa-input-text placeholder="Text-ID"
                                />
                            </div>

                            <div className={"newTranslationInputField"}>
                                <axa-input-text placeholder="Stage"
                                />
                            </div>

                            <div className={"newTranslationInputField"}>
                                <axa-input-text placeholder="DE"
                                />
                            </div>

                        </AXAModalReact>
                    </Grid>
                </Grid>
                <TranslationTable/>

            </MuiThemeProvider>
        </div>
    );
}
